import "../../index.css";

function Button({ children, textOnly, ...props }) {
  let btnClasses = textOnly ? "button-text" : "button-color";
  console.log(typeof btnClasses);

  return (
    <button className={btnClasses} {...props}>
      {children}
    </button>
  );
}

export default Button;
